import React from 'react';
import { useNavigate } from 'react-router-dom';
import './LandingPage.css'; // Make sure this CSS file is created

const Navbar = () => {
  const navigate = useNavigate();
  return (
    <nav className="lp-navbar">
      <div className="lp-logo">
        <div className="lp-logo-icon">ðŸŽ“</div>
        EventSphere
      </div>
      <div className="lp-nav-links">
        <span>Home</span>
        <span>Events</span>
        <span>Workshops</span>
        <span>About</span>
      </div>
      <div className="lp-auth-buttons">
        <span className="lp-login-text" onClick={() => navigate('/signin')}>Log in</span>
        <button className="lp-signup-btn" onClick={() => navigate('/signup')}>Sign up free</button>
      </div>
    </nav>
  );
};

const Hero = () => {
  const navigate = useNavigate();
  return (
    <section className="hero-wrapper">
      <div className="hero-content">
        <h1 className="hero-title">EVENTSPHERE</h1>
        <h2 className="hero-subtitle">The Ultimate Campus Event Management Platform...!</h2>
        <p className="hero-description">
          Streamline event planning, boost student engagement, and simplify venue booking. 
          The all-in-one platform built for modern universities.
        </p>
        <div className="button-group">
          <button className="btn-get-started" onClick={() => navigate('/signup')}>Get Started</button>
        </div>
      </div>

      <div className="hero-image-container">
        <img 
          src="https://miro.medium.com/v2/resize:fit:1400/1*DEmjwMFD4JTqtdasWJ5Reg.jpeg" 
          alt="Students on campus" 
        />
      </div>
    </section>
  );
};

const LandingPage = () => {
  return (
    <div className="landing-page-container">
      <Navbar />
      <Hero />
    </div>
  );
};

export default LandingPage;
